import React from 'react';
import Footer from './elements/footer'
import Register from './unprotected/register';
import Login from './unprotected/login';
import notFound from './unprotected/404';
import Home from './unprotected/home';
import Skillprofile from './unprotected/skill.profile';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  Redirect
} from "react-router-dom";
import { ProtectedRoute } from "./protected.route";
import { PreparedRoute } from "./prepared.route";

const PublicLayout =({children}) =>{
    return(
        <>
        <div>
        <Switch>
            <Route path="/app/skills/:idname" component={Skillprofile}/>  
            <Route path="/skills/:idname" component={Skillprofile}/>  
            <Route path="/terms"  component={Login}/>
            <Route path="/privacy"  component={Login}/>   


            <PreparedRoute exact path='/login' component={Login} />
            <PreparedRoute exact path='/register' component={Register} />   
            <PreparedRoute exact path='/' component={Home} />
            <Route path="*" component={notFound}/>      
        </Switch>

        </div>
        <main>{children}</main>
        </>
    )
}

export default PublicLayout;
